import {useNavigate} from 'react-router-dom';
import VideoComp from './videoComp';
import React from 'react';

export const Page1 = () => {
    const btn: HTMLButtonElement = document.getElementById('btn') as HTMLButtonElement;
    const closeBtn = document.getElementById('close') as HTMLButtonElement;
    const btn1 = document.getElementById('hamBtn1') as HTMLButtonElement;
    const btn2 = document.getElementById('hamBtn2') as HTMLButtonElement;
    const btn3 = document.getElementById('hamBtn3') as HTMLButtonElement;
    const sideBar: HTMLCanvasElement = document.getElementById('sideBar') as HTMLCanvasElement;
    sideBar.hidden = true;

    const event = async (): Promise<void> => {
        btn.style.display = 'none';
        sideBar.hidden = false;
    };
    btn.onclick = event;
    const closeEvent = () => {
        btn.style.display = '';
        sideBar.hidden = true;
    };
    closeBtn.onclick = closeEvent;
    return (
        <div>
            <VideoComp/>
        </div>
    );
};
